      "announcement": "Welcome to my Art Pendant Necklace Shop!!\r\nAll of my picture pendants are 1 inch (25mm) in size and come with necklace chains that are 24 inches (61cm) long.  I can cut the chains shorter by request.\r\n\r\nIf you would prefer your resin art pendant in a different color metal plating let me know and I will make the switch. I offer the round in silver or bronze and the square in silver and in bronze as well if you prefer.\r\n\r\nPlease be aware that there can be a slight difference in color between what is displayed on your devise screen and what I can duplicate on the printed pendant image. Every screen displays a little bit different. A back-lite computer screen and a printed image are two different animals. I use high quality matte photo paper for the best reproduction possible.  I think you will be pleased with what you receive.\r\n\r\n=== Search By Topic ===\r\nPlease use my shops search box below to find what you are looking for. \r\nI do custom requests. If you cannot find a map or a picture to match your idea, let me know. \r\n\r\n=== See Discount Offers Here ===\r\nIf you would like to take advantage of a discount offer, please see the section DISCOUNT OFFERS on my home page. If you would like a different quantity just ask and I will accommodate that for you.\r\nwww.etsy.com\/shop\/MGArtisanPendants\/search?search_query=discount&order=date_desc&view_type=gallery&ref=shop_search\r\n\r\nMy pendants will arrive individually gift wrapped.\r\n\r\nThere may be custom charges to be paid by buyer on overseas shipments. Please keep that in mind when making your purchase. \r\n\r\nI hope you enjoy my selection of beautiful picture pendant necklaces.\r\n\r\nThanks for stopping by.\r\n\r\nMark G.",
