      "is_vacation": false,
      "vacation_message": "=== My shop in on vacation until July 8th. ===",
      "sale_message": "Thank you so much for deciding to purchase from my shop.\r\nI strive to make quality pendants that you will be happy with.\r\nIf for any reason you have any questions please see my policies page or convo me.\r\n\r\nAll the best.\r\nMark G.\r\n\r\n",
