      "policy_welcome": "I hope you enjoy my assortment of beautiful metal tray pendants. \r\n\r\nAll pendants include necklace chains. They come 24 inches long. I can adjust them shorter for you upon request.\r\n\r\nIf you do not find the answer to your questions here, please contact me by clicking on the Contact button in the left hand column. \r\n\r\nThanks so much.\r\nMark G.",
      "policy_payment": "I accept Credit Cards, PayPal, Money Orders and Personal Checks.\r\nInternational buyers PayPal only.\r\n\r\nCredit Cards are accepted direct through Etsy or through PayPal. PayPal eChecks will delay shipment until the payment is in my account (about 4 days).\r\n\r\nPlease make out your Money Orders and Personal Checks to Mark Gilbert.\r\nPersonal checks will delay shipment for the check to clear (about 1 week).\r\n\r\nIf no contact is received from buyer regarding payment within 7 days the transaction will be canceled.",
      "policy_shipping": "My pendants are made to order. \r\nLarger orders will take a bit longer but normally I ship orders 1 to 2 days after I receive them via: \r\n\r\nUSA  - \r\nUSPS First Class with Delivery Confirmation, 3 to 4 business days (now with tracking at usps.com)\r\n\r\nInternational - \r\nUSPS First Class International, 7 to 14 business days. Customs can delay up to an additional 14 days. No tracking on International shipments.\r\nAdditional custom fees may apply.\r\n\r\n",
