      "is_vacation": false,
      "vacation_message": null,
      "sale_message": "Thanks for your order! \r\n \r\nMost maps are processed in 4-7 days for none custom prints.For custom prints, we&#39;ll be in touch with you to get the details correct. Custom art work usually requires an email proof and your approval before printing and can increase the processing time by a week sometimes.\r\n\r\nREMBER:\r\nWe do not ship foamboards or framed works internationally due to the high costs of taxes,duties and shipping.\r\n\r\nWe charge a flat rate for most international orders, but some larger prints and very distant destinations MAY REQUIRE ADDITIONAL SHIPPING costs. If this is the case, we will email you  an invoice for the adjusted total.\r\n------------------------------------------------------------------\r\n Visit our other shops on Etsy.\r\n\r\nCustom Travel Maps\r\nhttps:\/\/www.etsy.com\/shop\/TheTravelMapStore\r\n\r\n&quot;REAL&quot; WORLD MAPS and PULL-DOWN MAPS\r\nhttps:\/\/www.etsy.com\/shop\/WaterColorMaps2\r\n\r\nBOTANICAL PRINTS\r\nhttps:\/\/www.etsy.com\/shop\/TheOldFern?ref=search_shop_redirect\r\n\r\nUNIQUE MAP ART\r\nhttps:\/\/www.etsy.com\/shop\/SplatterMaps\r\n\r\n-------------------------------------------------------------------------------------------------\r\nOther Information:\r\n\r\n\r\n***We can print ANY of our maps on a synthetic matte banner canvas on sizes up to 8x10ft (or bigger if needed).  Just email us for details.\r\n\r\n------------------------------------------------------------------------------------------------\r\n\r\n                                                  Thanks, Chris and Mary Ann",
      "digital_sale_message": null,
      "last_updated_tsz": 1421957462,
      "listing_active_count": 354,
      "login_name": "watercolormaps",
      "accepts_custom_requests": false,
      "policy_welcome": "Thank you for your interest in our work.  We have been selling our artwork and prints for many years, but this Etsy shop is a recent venture for us.\r\n\r\nBelow are some answers to general shop policies regarding orders, shipping, payment, and returns.\r\n\r\nIf you have any additional questions or need assistance, please feel free to contact us through Esty or watercolormaps(at)hotmail.com.",
      "policy_payment": "You do not have to sign up for a PayPal account in order to use your credit card through PayPal.\r\n\r\nIf this is your first time using PayPal, you will find that it is quick, easy, and very secure. Just put an item in your cart and click checkout, and you will quickly go through the payment process.\r\n\r\nIf you need a custom print, a larger size, or one printed on canvas, just email us for pricing and details.\r\n\r\nWe can accept other payment methods if necessary\u2014just ask!",
      "policy_shipping": "\r\n\r\n*****IMPORTANT*****\r\n We charge a flat rate for most international shipping orders and on the average we lose a dollar or two on the shipping, but we try to keep our products affordable for customers around the world.  Some LARGER POSTERS AND VERY DISTANT LOCATIONS will require us to contact you with additional shipping charges. If this is the case we will email you with a new shipping fee(the difference that you have already paid). \r\n--------------------------------------------------------------------\r\nWe know how excited you are to receive your new purchase, so orders are placed within 24 hours. The company we use to print our images is located in Rhode Island, and once your order is placed with us, the printing process starts there. On average, your print will arrive in 5-7 days after the order is placed in the US. \r\n\r\nRather than personally printing our products, we decided to use a professional printing company to increase your options, ensure consistent results, and offer the highest quality prints....at a fantastic price.\r\n\r\nAll custom orders will require extra processing time, and we&#39;ll communicate those details when we confirm your order.\r\n--------------------------------------------------------------------\r\n\r\nPurchases made within the US will ship via USPS First-Class Mail. Orders will be shipped to the address listed with PayPal unless you designate otherwise.\r\n\r\nInternational orders may receive a US Customs Number.\r\n\r\n*** Please note that once an order leaves the US it can no longer be tracked.\r\n\r\n*** International orders can take anywhere from 2-6 weeks to arrive, and possibly longer, depending on your location and if they get held up in Customs.\r\n\r\n----------------------------------------------------------------------------\r\n\r\nYour order is sent out with the utmost care in a poster tube. If your order is lost or bent\/damaged by the Post Office, please contact us so we can follow up with the printing company to get a replacement\u2013at no charge to you\u2013as soon as possible.  You have 7 days for a full refund (minus the shipping charges you incur to mail it back to us).\r\n\r\nPlease inform us at the time of checkout if you have any special requests.",
      "policy_refunds": "WaterColorMaps is proud to offer interesting and high-quality prints. Depending on your monitor, the colors displayed on your screen may appear slightly different from the print you receive.\r\n\r\nPlease contact us right away if you have any questions or issues with your purchase.\r\n\r\nIf for any reason you are not 100% satisfied with your print(s), please contact us prior to leaving feedback. Refunds are available within 7 days of receipt of your package minus the cost of shipping.\r\n\r\nPlease return the item in the original packaging to WaterColorMaps (our address will be provided to you)\u2013and not the printing company\u2013and we will issue a refund to you.\r\n\r\nIf the error is on our end, you will get a complete refund or replacement; whichever you choose.\r\n",
      "policy_additional": "Thanks for visiting our Etsy shop offering uniquely created and hard-to-find prints!",
