    "title": "South Carolina Art - South Carolina Map - Charleston, SC - Greenville SC - Fully Custom 8x10 graphic print",
    "description": "South Carolina...\r\n\r\nMiles and miles of beaches, Hilton Head, Myrtle Beach, gorgeous gardens and plantations, and home to some big names such as Dizzy Gillespie, Andie MacDowell, and William &quot;The Refrigerator&quot; Perry. \r\n\r\nNot to mention the coolest state logo ever.\r\n________________________________________________________________________\r\n\r\nYou know what&#39;s awesome about this print? It&#39;s FULLY customizable - you can choose the color, the words, the icon over YOUR city, anything you want! \r\n\r\nI&#39;ve had clients add city names, first names, their initials or a special date.\r\n________________________________________________________________________\r\nGIMME ALL THE DETAILS:\r\n\r\n-Print measures 8x10 and has a 3\/4&quot; white border all around for easy framing!\r\n\r\nPlease let me know the following:\r\n1. Background Color - The drop down menu references my color choices (Photo 4)\r\n2. Icon - The drop down menu references my icon choices (Photo 5)\r\n3. Your city\r\n4. If you&#39;d like any wording changes or any additional information on the print\r\n5. If you&#39;d like the texture and\/or darkened edges removed - \r\nI can do a solid background too\r\n\r\n-Printed on ultra premium matte paper with archival pigment inks. \r\n(For some seriously ah-mazing colors!)\r\n\r\n-If you&#39;d like a color change, please use my color chart for the best consistency.\r\n(Because my &quot;light blue&quot; might not be YOUR &quot;light blue&quot;)\r\n________________________________________________________________________\r\nSHIPPING AND STUFF: \r\n\r\n-Packaged securely with double cardboard backing and a protective sleeve\r\n(So your print doesn&#39;t get cold)\r\n\r\n-Shipped via USPS. With love. \r\n(I can&#39;t promise the love directly from the USPS, but I can promise it from me)\r\n\r\nPLEASE NOTE - the black frame around the display photo will not be included - this listing is for an unmatted, unframed print only.\r\n________________________________________________________________________\r\nYEAH, WELL, WHAT ELSE YA GOT?\r\n\r\nTo see the rest of my geographical home decor, swing on by: \r\nhttp:\/\/www.etsy.com\/shop\/PaperFinchDesign?section_id=12939546\r\n\r\nI just opened a new shop to sell my designs in their original cardstock format. \r\nWe&#39;re talking discounts, people!\r\nwww.etsy.com\/shop\/PaperFinchOutlet\r\n________________________________________________________________________\r\nBUT WAIT, THERE&#39;S MORE!\r\n\r\nI am also available for any custom graphic design work - invitations, party decor, stationery, you name it! Just convo me!\r\n________________________________________________________________________\r\nAll images copyright PaperFinch Design 2013",
