      "creation_tsz": 1300833941,
      "title": "Home Decor, Stationery, and Invitations",
      "announcement": "Home decor that&#39;s bright, fun, and affordable. Because that&#39;s how life should be.\r\nFeatured on People.com, Cake & Whiskey magazine, and Clin d&#39;oeil magazine\r\n\r\nI&#39;m in the process of upgrading all of my prints to fine art, archival quality and that means a SALE on my original, cardstock prints! \r\n\r\nAnd so...for a limited time - I have an Outlet Shop! www.etsy.com\/shop\/PaperFinchOutlet",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": "Happy Holidays!\r\n\r\nI will still be checking emails and answering questions, but I am closing my shop for a few days as I will be traveling and cannot ship any items until after Christmas.\r\n",
      "sale_message": "Thank you so much for your purchase! If you have any questions for me, don&#39;t hesitate to ask.\r\n\r\nIf you purchased a custom order, please keep an eye out for your proof within 2-4 business days. I will send this proof via your Etsy inbox, so check back in!\r\n\r\nIf you purchased a non-custom order, your product will be in the mail within 2-4 business days.\r\n\r\nThank you!\r\nAmy",
      "digital_sale_message": null,
      "last_updated_tsz": 1421953501,
      "listing_active_count": 552,
      "login_name": "PaperFinchDesign",
      "accepts_custom_requests": true,
      "policy_welcome": "Hi there and welcome to PaperFinch Design!\r\n\r\nI am the owner, creator, and graphic designer behind PaperFinch - so I&#39;m basically your one-stop shop for any graphic design needs!\r\n\r\nIf you like my style, but don&#39;t see just what you need in my shop, just convo me and I&#39;m sure I can create it!",
      "policy_payment": "PAYMENT FOR CUSTOM PRINTS:\r\nPayment is due at purchase. Please note any custom requests (including colors, wording, etc) at the time of purchase - either in the Notes to Seller section or as a direct convo to me. I will start sending proofs within 3 business days* of purchase, and we will work together until it is absolutely perfect. Once I get the official &quot;thumbs up&quot; from you, I will send it to print. \r\n\r\nDue to the nature of these prints, I do require that you purchase before I do any custom work or send proofs.\r\n\r\n**For pre-designed custom prints - if I have sent you a proof(s) and have not heard from you within 14 days of sending said proof(s), I will send the product without receiving a verbal okay from you.\r\n\r\n**For fully custom orders - if I have sent you a proof and have not heard from you within 60 days of purchase, I will delete the file and you will have to purchase the deposit amount again.\r\n\r\n\r\nPAYMENT FOR NON-CUSTOM PRINTS:\r\nPayment is due at purchase. Please note any color change requests (if applicable) at the time of purchase - either in the Notes to Seller section or as a direct convo to me. I will ship your print within 2-4 business days*. \r\n\r\n\r\nPAYMENT FOR PRINTED INVITATIONS:\r\nPurchase the invitation listing as is. This will serve as a deposit towards your final amount. Next, please submit all color change requests and wording for invitations at the time of purchase - either in the Notes to Seller section or as a direct convo to me. For the most part, I have prices for my printed products listed, but if I don&#39;t just convo me and I&#39;ll work you up a quote before you purchase. I will start sending proofs within 3 business days* of purchase, and we will work together until it is absolutely perfect. Once I get the official &quot;thumbs up&quot; from you, I will send it to print. \r\n\r\n**Please note, if I have sent you a proof and have not heard from you within 60 days of purchase, I will delete the file and you will have to purchase the deposit amount again.\r\n\r\n\r\nPAYMENT FOR PRINTABLE INVITATIONS:\r\nPayment is due at purchase. Please submit all color change requests and wording for invitations at the time of purchase - either in the Notes to Seller section or as a direct convo to me. I will start sending proofs within 3 business days* of purchase, and we will work together until it is absolutely perfect. Once I get the official &quot;thumbs up&quot; from you, I will send a final, printable PDF to the email address you submitted to Etsy.\r\n\r\n*Business days are Monday - Friday, excluding any U.S. holidays.\r\n\r\n**Please note, if you need a jpeg or an RGB jpeg, please just ask!\r\n\r\n",
      "policy_shipping": "HOW IS MY ORDER SHIPPED?\r\nYour order will be shipped via USPS First Class Domestic or USPS First Class International Mail. \r\n\r\nIf you would like to upgrade to Priority Shipping, just purchase this listing: https:\/\/www.etsy.com\/listing\/118299795\/upgrade-to-usps-priority-shipping?ref=shop_home_active&ga_search_query=priority\r\n\r\n\r\nHOW IS MY ORDER PACKAGED?\r\nYour order will be securely packaged in a plastic poly sleeve with double cardboard backing. I will then tape the heck out of the envelope flap, to ensure that no moisture gets in to ruin your print!\r\n\r\nNotecards will be secured in a poly bag as well, to keep them from sliding around and having a party inside of the envelope. \r\n\r\n",
      "policy_refunds": "CAN I GET MY MONEY BACK?\r\nWell I sure hope it doesn&#39;t come to that! But if you are truly unhappy with your purchase from PaperFinch, just return your purchased print and I will be happy to refund your money, including the original shipping cost. \r\n\r\nEVEN FOR PRINTABLE PDFS?\r\nWell, no. Due to the nature of printable products, once I have sent them to your email address, I cannot offer refunds. \r\n",
      "policy_additional": "I always welcome custom orders - got a themed party coming up or an idea for a custom home decor item? Just let me know and I&#39;ll come up with something perfect for you!",
      "policy_seller_info": null,
      "policy_updated_tsz": 1418954089,
